export const childComp = () => {
    const [addUsers, setAddUsers] = useState([]);
    const users = ['Ana', ' Blerina', 'Driton']
    return (
        <>
        <ul>
        {users.map((users, index) => (
            <li key={index}>{users}</li>
          ))}
        </ul>
        </>
    )
}
